import React, {Component} from 'react';
import {connect} from 'react-redux';
import {bindActionCreators} from 'redux'
import {getDOWRequest} from '../actions/dow';
import axios from 'axios'
import {Button, Input} from 'reactstrap';
axios.defaults.baseURL = 'https://www.quandl.com/api/v3/datasets'

class App extends Component {
    constructor(props){
      super(props);
      this.props.getDOWRequest();
    }
    handleClick = () => {
      this.props.getDOWRequest();
      console.log(props)

    }
    render(){
        return (
            <div style={{margin: '0 auto', padding: '20px', maxWidth: '600px'}}>
                <Input type = "date" />
                <Button onClick = {() => this.handleClick()}> Get DOW Quotes </Button>
            </div>
        );
    }
}

const mapStateToProps = state => {
  return {
    items: state.items
  };
};

const mapDispatchToProps = (dispatch) => {
  return bindActionCreators(
    {
      getDOWRequest: getDOWRequest,
    },
    dispatch);
};

export default connect(mapStateToProps, mapDispatchToProps)(App);
